import React, { useState, useEffect, useContext } from 'react';
import { DragDropContext, Droppable } from 'react-beautiful-dnd'; // Import DragDropContext and Droppable
import { useDrop } from 'react-dnd';
import { ItemTypes } from './ItemTypes'; // Define item types
import InProgressTaskList from './InProgressTaskList';
import DelayedTaskList from './DelayedTaskList';
import CompletedTaskList from './CompletedTaskList';
import EventCard from './EventCard';
import TaskList from './TaskList';
import TaskContext from './TaskContext'; // Import TaskContext
import { v4 as uuidv4 } from 'uuid'; // Import uuid

function Dashboard() {
  const [toDoTasks, setToDoTasks] = useState([]);
  const [inProgressTasks, setInProgressTasks] = useState([]);
  const [delayedTasks, setDelayedTasks] = useState([]);
  const [completedTasks, setCompletedTasks] = useState([]);
  const { sourceSection } = useContext(TaskContext); // Get sourceSection from TaskContext

  useEffect(() => {
    // Clear in progress, delayed, and completed tasks when toDoTasks change
    setInProgressTasks([]);
    setDelayedTasks([]);
    setCompletedTasks([]);
  }, [toDoTasks]);

  const onDragEnd = result => {
    const { destination, source, draggableId } = result;

    if (!destination) {
      return;
    }

    switch (source.droppableId) {
      case 'todo':
        switch (destination.droppableId) {
          case 'inProgress':
            setInProgressTasks(prevState => [...prevState, { id: uuidv4(), title: toDoTasks[source.index].title }]);
            break;
          case 'completed':
            setCompletedTasks(prevState => [...prevState, { id: uuidv4(), title: toDoTasks[source.index].title }]);
            break;
          case 'delayed':
            setDelayedTasks(prevState => [...prevState, { id: uuidv4(), title: toDoTasks[source.index].title }]);
            break;
          default:
            // By default, move to ToDo
            setToDoTasks(prevState => [...prevState, { id: uuidv4(), title: toDoTasks[source.index].title }]);
        }
        break;
      // Handle other cases if needed
      default:
        break;
    }
  };

  return (
    <DragDropContext onDragEnd={onDragEnd}>
      <div>
        <div className="dashboard">
          <aside className="sidebar">
            <h2>Upcoming Events</h2>
            <EventCard />
          </aside>
          <div className="main-section">
            <main className="main-content" style={{ height: "fit-content", width: "100%" }}>
              <h1>Main Content</h1>
              <p>This is the main content area of the dashboard.</p>
            </main>  
            <div style={{display: 'flex'}}>
              <Droppable droppableId="todo">
                {(provided) => (
                  <div ref={provided.innerRef} {...provided.droppableProps}>
                    <div className="column">
                      <div className="column-section">
                        <h2>ToDo</h2>
                        <TaskList tasks={toDoTasks} sourceSection={sourceSection} />
                      </div>
                    </div>
                    {provided.placeholder}
                  </div>
                )}
              </Droppable>
              <Droppable droppableId="inProgress">
                {(provided) => (
                  <div ref={provided.innerRef} {...provided.droppableProps}>
                    <div className="column">
                      <div className="column-section">
                        <h2>InProgress</h2>
                        <InProgressTaskList tasks={inProgressTasks} />
                      </div>
                    </div>
                    {provided.placeholder}
                  </div>
                )}
              </Droppable>
              <Droppable droppableId="completed">
                {(provided) => (
                  <div ref={provided.innerRef} {...provided.droppableProps}>
                    <div className="column">
                      <div className="column-section">
                        <h2>Completed</h2>
                        <CompletedTaskList tasks={completedTasks} />
                      </div>
                    </div>
                    {provided.placeholder}
                  </div>
                )}
              </Droppable>
              <Droppable droppableId="delayed">
                {(provided) => (
                  <div ref={provided.innerRef} {...provided.droppableProps}>
                    <div className="column">
                      <div className="column-section">
                        <h2>Delayed</h2>
                        <DelayedTaskList tasks={delayedTasks} />
                      </div>
                    </div>
                    {provided.placeholder}
                  </div>
                )}
              </Droppable>
            </div>
          </div>
        </div>
      </div>
    </DragDropContext>
  );
}

export default Dashboard;
